import React, { useEffect } from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import { UilExport } from "@iconscout/react-unicons";
function EmployeePage(props) {
  const { employees, fetchEmployees } = props;
  useEffect(() => {
    fetchEmployees();
  }, [fetchEmployees]);
  return (
    <div className="font-medium text-sm">
      <div className="h-12 bg-slate-200 flex justify-between items-center px-5">
        <div>
          <span>Total:</span>
          <span className="text-blue-700 mx-2">#</span>
        </div>
        <div className="text-white flex items-center ">
          <Link
            to="add"
            className=" bg-sky-600 px-2 py-1 rounded hover:bg-sky-700 ml-2"
          >
            Add
          </Link>
          <Link
            to="add"
            className=" bg-sky-600 px-2 py-1 rounded hover:bg-sky-700 ml-2"
          >
            Import
          </Link>
          <Link
            to="add"
            className="flex item-center bg-sky-600 px-2 py-1 rounded hover:bg-sky-700 ml-2"
          >
            <UilExport className="h-4 w-4 mr-1" />
            <span>Export</span>
          </Link>
        </div>
      </div>
      {employees[0] ? (
        <ul>
          {employees.map((item) => {
            return <li key={item.id}> {item.name}</li>;
          })}
        </ul>
      ) : (
        <p>No data</p>
      )}
    </div>
  );
}

EmployeePage.propTypes = {
  employees: PropTypes.array.isRequired,
  fetchEmployees: PropTypes.func,
};
EmployeePage.defaultProps = {
  fetchEmployees: null,
};
export default EmployeePage;
